import logofull from './images/logofull.png';
import './AdminHome.css';
function AdminHome() {
    return (
        <div class="main">
            <header>
                <div class="logo">
                    <img src={logofull} alt=""></img>
                </div>

              
                <div id="pp">

                </div>
                <span id="name">
                    Ayush Solanki
                </span>
            </header>
        </div>
    );
}

export default AdminHome;
